INSERT INTO `eb_agreement` (`id`, `type`, `title`, `content`, `sort`, `status`, `add_time`) VALUES (1, 1, '付费会员协议', '<p>请认真阅读并理解以下内容，本协议是您与西安众邦网络科技有限公司之间就SVIP会员所订立的契约。请您仔细阅读本协议，会员购买成功后本协议即构成对双方有约束力的法律文件。</p><p><br/></p><h4>第1条 相关定义</h4><p><br/></p><p>1.1 SVIP会员：SVIP 会员是为商城客户打造的高级会员服务，通过提供高品质的客户服务，让网购变的更加方便，省钱和放心。</p><p>1.5 实名信息：用户开通SVIP会员需保证商城用户信息真实，同一自然人如有多个商城账号，可同时开通对应的多个会员。</p><p><br/></p><h4>第2条 本站服务条款的确认和接纳</h4><p><br/></p><p>2.1 本站所提供的SVIP会员试用期及正式期活动的所有权和运作权归本公司所有。</p><p>2.2 用户支付会员成功，即视为用户确认自己同意接受SVIP会员相关服务的条款，且同意按本协议内容履行，如产生用户相关责任的，同意承担相应法律责任。</p><p>2.3 如果您在18周岁以下，您只能在父母或监护人的监护参与下方能参与体验该服务。</p><p>2.4 本公司保留在中华人民共和国大陆地区法施行之法律允许的范围内独自决定拒绝服务、关闭用户账户、清除或编辑内容等相关权利。</p><p>2.5 SVIP会员开通后，您在已开通的服务期内不能主动取消服务或终止资格。</p><p><br/></p><h4>第3条 SVIP会员权益</h4><p><br/></p><p>3.1 会员特价：商城部分商品可享受会员特价</p><p>3.2&nbsp;会员优惠券：会员每月可领优惠券，会员优惠券用户在会员期间30天内未使用，自动作废；</p><p>3.3&nbsp;消费返利：消费返X倍积分</p><p>3.4&nbsp;签到返利：签到得多倍积分</p><p>3.5&nbsp;运费折扣：享受运费折扣XX折</p><p>3.6&nbsp;支付优惠：线下扫码付款享折扣优惠</p><p><br/></p><h4>第4条 用户会员使用注意事项</h4><p><br/></p><p>4.1 服务开通后，用户应谨慎合理的保存、使用其用户名和密码，不得将在本站注册获得的账户借给他人使用，否则用户应承担由此产生的全部责任，同时本公司在该种情况下有权做出独立判断，可采取暂停或关闭用户会员资格等措施。</p><p>4.3 用户同意，商城拥有通过邮件、短信电话等形式，向其发送相关活动信息等必要信息的权利。</p><p>4.4 SVIP用户通过账号操作的各项行为应符合法律法规规定、平台规则规定及SVIP会员正式用户协议，当出现违规行为、违规订单及违规账号时，本公司有权按照上述平台内规则对您的账号和订单予以处理，如冻结或关闭账号、取消订单、暂停或停止提供服务、关闭会员开通资格、关停已开通的会员服务，已绑定的或获取的SVIP会员权益被全部/部分取消或暂停使用等操作，且不进行任何赔偿或补偿。如给本公司或相关方造成损失，用户需承担全部责任。从公平合理的角度，您应知晓所有通过该账户实现的操作产生的全部后果由您自行承担。</p><p>4.5 SVIP用户违规行为包含但不限于以下行为时，本公司有权关闭您的SVIP会员开通资格、关停您已开通的SVIP会员服务，已绑定的或获取的SVIP会员权益被全部/部分取消或暂停使用，且不退还已支付的会员服务费用。从公平合理的角度，您应知晓所有通过该账户实现的操作产生的全部后果或损失由您自行承担。</p><p>1）利用SVIP会员服务进行盈利或非法获利；</p><p>2）以任何形式转让或转移SVIP会员服务或SVIP会员权益；</p><p>3）将SVIP会员服务或会员权益借给他人使用、代他人下单；</p><p>4）通过任何不正当手段或以违反诚实信用原则的方式开通SVIP会员服务，如恶意绕过正常开通流程；</p><p>5）使用SVIP会员权益获取的商品或服务并非用于个人消费或使用；</p><p>7）用户在使用会员服务时，存在套取优惠利差、虚假下单交易、提供虚假交易信息等扰乱交易秩序、违反交易规则的行为；</p><p>8）经本公司判断，SVIP用户行为不符合公平原则或诚实信用原则的情形。</p><p><br/></p><p>4.6 SVIP会员兑换码：即由本公司提供的开通SVIP正式会员识别码，用户可在实体会员卡扫码进入开通入口输入，系统识别成功后该账户便可享受相应期限的SVIP正式会员服务。</p><p>4.6.1 每个SVIP会员兑换码仅限兑换一次，一经绑定，仅可用于被绑定的账户，不能解绑或换账户使用。</p><p>4.6.2 SVIP会员兑换码一旦兑换，属个人所有，个人应妥善保管，本公司不对SVIP会员兑换码的泄露、丢失、被盗等其他不能使用或不能激活的情况负责。</p><p>4.6.3 用户通过正当途径获取的SVIP会员兑换码，不得进行销售。若发现立即冻结，兑换码置为失效，通过此码激活开通的账户也将终止SVIP会员资格，用户双方全部加入黑名单。</p><p><br/></p><h4>第6条 法律管辖和适用</h4><p><br/></p><p>本公司有权以网站公告的方式进行不定期地制定、修改本协议及/或相关服务规则，暂停、取消和修改本协议条款，修改后的协议一旦被公告在本站上即生效，并代替原来的协议。用户应及时关注不时发布的各项服务规则及本协议的变更。若不同意相关规则及条款修改的，应及时终止与本站的协议。如用户继续使用本网站提供的服务的，即视为同意更新后的协议。建议您在使用本站之前阅读本协议及本站的公告。如缔约方就本协议内容或其执行发生任何争议，双方应尽力友好协商解决；协商不成时，任何一方均可向西安市未央区中级人民法院提起诉讼。</p><p><br/></p><h4>第7条 其他</h4><p><br/></p><p>7.1 公司网站所有者是指在政府部门依法许可或备案的网站经营主体。</p><p>7.2 &nbsp;如因不可抗力或其它本站无法控制的原因使本站活动服务无法及时提供或无法按本协议进行的，公司会合理地尽力协助处理善后事宜。</p><p>7.3 本协议自您购买成功SVIP之日起生效</p><p><br/></p>', 0, 1, 1664275153);
INSERT INTO `eb_agreement` (`id`, `type`, `title`, `content`, `sort`, `status`, `add_time`) VALUES (2, 2, '代理商规则', '<p><b>代理商协议</b><br/><br/>在接受本协议之前，请您仔细阅读本协议全部内容。如果您对本协议的条款有疑问，请通过商城客服进行咨询，我们会向您解释条款内容。如果您不同意本协议的任何内容，或者无法准确理解商城对条款的解释，请不要进行后续操作。<br/><br/><b>第一条：立约目的</b><br/><br/>1.1 为了规范商城平台经营秩序，明确代理商及平台的权利义务，保障各方及消费者的合法权益，特拟定本协议。<br/><br/><b>第二条：签约主体</b><br/><br/>2.1 本协议由商城经营者（平台）与申请成为分销商的用户签署。<br/><br/><b>第三条：协议生效和适用范围</b><br/><br/>3.1 您通过网络页面点击确认或以其他方式选择接受本协议，即表示您与平台已达成协议并同意接受本协议的全部约定内容。本协议自您的申请获得平台通过时生效，在您使用代理商身份期间持续有效，在您的代理商身份取消时自动失效。<br/><br/>3.2 本协议内容包括协议正文以及所有平台已发布或将来可能发布的各类规则、操作流程。平台有权以修改、更新等方式不时调整本协议和相关规则的内容。除非您明示并通知平台不愿接受调整后的内容，否则调整后的内容将于修改之日起开始生效<br/><br/><b>第四条：代理商入驻</b><br/><br/>4.1 您申请入驻平台代理商需符合代理商的入驻条件，并通过申请页面提交申请。<br/><br/>4.2 如果您的申请通过平台审核，您可在审核通过之日起与平台确立分销代理关系。代理合作关系确立后，代理商可登录系统后台，添加公司成员成立事业部及代理项目组，并分配激励奖金<br/><br/><b>第五条：代理商承诺与保证</b><br/><br/>5.1 您承诺遵守本协议以及之后平台公布的规则及流程。<br/><br/>5.2 代理商在平台开展的经营活动应遵循诚实守信原则，遵纪守法，为消费者提供优质的商品和服务，快速高效处理交易纠纷。<br/><br/>5.3 代理商与平台有权自行协商解除双方的代理合作关系。如代理商违反平台规则，平台有权立即解除与代理商的合作关系，但合作关系解除前双方已产生的权利义务与责任不受合作关系终止的影响。<br/><br/><b>第六条：协议终止</b><br/><br/>6.1 自然终止：当商城平台停止运营或商城《用户协议》等终止时，则本协议将同时终止。<br/><br/>6.2 通知解除：平台可提前7天以公告或书面通知的方式终止本协议而无需承担违约责任<br/><br/>6.3 单方面除权：出现下列情况之一的，平台有权立即终止本协议，且按有关规则对您进行处罚：<br/><br/>（1）您违反本协议中的任何承诺或保证，包括但不限于本协议项下的任何约定；<br/><br/>（2）您违反平台的相关条款、协议、规则、通告等相关规定，而被平台停止提供服务的；<br/><br/>（3）您被平台清退。<br/><br/>6.4 本协议规定的其他协议终止条件发生或实现，导致本协议终止。<br/><br/>6.5 本协议终止后，代理商无权继续分销产品，但本协议终止前发生的交易，代理商仍需按照本协议的约定向消费者继续履行相关义务。<br/><br/><b>第七条：禁止商业贿赂</b><br/><br/>您不得向平台员工提供任何形式的不正当利益，如有，无论您是否实际获得利益，平台均有权立即解除本合同，并向平台赔偿因此事造成的损失金额。<br/><br/><b>第八条：违约责任</b><br/><br/>您明确理解并同意，如您违反有关法律法规、相关规则或者本协议之规定，使平台遭受任何损失，受到消费者或任何第三方的索赔或者遭受任何行政管理部门的处罚，您应对平台进行全额赔偿，包括合理的律师费用。<br/><br/><b>第九条：免责及有限责任</b><br/><br/>9.1 平台将在现有技术的基础上尽最大努力提供相应的安全措施以保障服务安全和正常运行。但由于可能存在的计算机病毒、网络通讯故障、系统维护等方面的因素以及可能发生的不可抗力事件，平台在此明确声明对服务不作任何明示或暗示的保证，包括但不限于对服务的可适用性、没有错误或疏漏、持续性、准确性、可靠性、适用于某一特定用途。<br/><br/>9.2 本协议的签署、您的入驻审核通过，并不意味着平台对您的入驻身份、资质、履约能力等行为或您自行上传、发布的信息的真实性、准确性、合法性、有效性承担任何明示或暗示的保证或担保等责任。因您的行为导致的任何投诉、纠纷、争议、赔偿等您应以自己的名义独立承担所有法律责任。<br/><br/><b>第十条：其他约定</b><br/><br/>本协议适用于中华人民共和国地区法律。因平台与您就本协议的签订、履行或解释发生争议，双方应努力友好协商解决。如协商不成，您同意由被告住所地人民法院管辖审理双方的纠纷或争议。</p>', 0, 1, 1666918814);
INSERT INTO `eb_agreement` (`id`, `type`, `title`, `content`, `sort`, `status`, `add_time`) VALUES (3, 3, '隐私协议', '<p>本隐私政策与您所使用的CRMEB服务以及该服务所包括的各种业务功能（以下统称“我们的产品与/或服务”）息息相关，希望您在使用我们的产品与/或服务前仔细阅读并确认您已经充分理解本隐私政策所写明的内容，并让您可以按照本隐私政策的指引做出您认为适当的选择。本隐私政策中涉及的相关术语，我们尽量以简明扼要的表述，并提供进一步说明的链接，以便您更好地理解。</p><p>&nbsp;</p><p><strong>一、我们如何收集和使用您的个人信息</strong></p><p>个人信息是以电子或者其他方式记录的与已识别或者可识别的自然人有关的各种信息，不包括匿名化处理后的信息。敏感个人信息是一旦泄露或者非法使用，容易导致自然人的人格尊严受到侵害或者人身、财产安全受到危害的个人信息，包括生物识别、宗教信仰、特定身份、医疗健康、金融账户、行踪轨迹等信息，以及不满十四周岁未成年人的个人信息。</p><p>我们会遵循正当、合法、必要的原则，出于本政策所述的以下目的，收集和使用您在使用产品与/或服务过程中主动提供或因使用产品与/或服务而产生的个人信息，以及从第三方获取您的相关个人信息。如果我们要将您的个人信息用于本政策未载明的其他用途，或将基于特定目的收集而来的信息用于其他目的，我们将以合理的方式向您告知，并在使用前再次征得您的同意。</p><p><strong>（一）您须授权我们收集和使用您个人信息的情形</strong></p><p>我们的产品与/或服务包括一些核心功能，这些功能包含了实现网上购物所必须的功能及保障交易安全所必须的功能。我们可能会收集、保存和使用下列与您有关的信息才能实现上述这些功能。如果您不提供相关信息，您将无法享受我们提供的产品与/或服务。这些功能包括：</p><p>1、实现网上购物所必须的功能</p><p><strong>（1）账号注册、登录与验证</strong></p><p>当您注册CRMEB账号时，您至少需要向我们提供您准备使用的CRMEB账号名、密码、手机号码、电子邮箱，我们将通过发送短信验证码或邮件的方式来验证您的身份是否有效，通过SIM卡信息识别并显示对应的运营商。您的账号名为您的默认昵称，您可以修改和补充您的昵称、性别、生日以及您的实名认证相关信息，这些信息均属于您的“账号信息”。您补充的账号信息将有助于我们为您提供个性化的商品推荐和更优的购物体验，但如果您不提供这些补充信息，不会影响您使用网上购物的基本功能。</p><p>当您成功注册CRMEB账号后，可以使用CRMEB账号登录“CRMEB商城”，登录时您需要向我们提供您的CRMEB账号信息。若您不提供这类信息，您将无法登录和在“CRMEB商城”购买商品，此时您可使用浏览和搜索功能，我们将不会收集您的上述个人信息。</p><p><strong>您可以选择仅使用您本人的脸部信息为您本人所持有的账号使用刷脸登录服务。为了通过您的人脸信息来确认您本人身份，您同意并授权我们获取您在本账号下的个人实名身份信息（姓名、身份证号码、身份证件照片）和面部照片，以便结合您的身份信息、人脸信息来核验您的身份。您若不希望您提供的面部识别信息被我们保存后用于后续您授权的比对核验，您可以选择撤回授权，退出后您的面部识别信息将不再用于后续的比对核验。具体撤回路径为“我的-账户设置-账户与安全-刷脸登录”。</strong></p><p><strong>（2）商品/服务信息展示和搜索</strong></p><p>为了向您展示商品或者服务，我们会收集您的设备信息（包括设备名称、设备型号、MAC地址及IMEI、设备识别码、移动应用列表等软硬件特征信息、操作系统和应用程序版本、语言设置、分辨率、服务提供商网络ID（PLMN））、设备所在位置相关信息（包括您授权的GPS位置信息以及WLAN接入点、蓝牙和基站传感器信息）、浏览器类型来对相应的商品或者服务内容进行排序以适应您的设备界面。</p><p>为了向您提供搜索历史、浏览记录、收藏的商品或店铺、关注的店铺、购物车或订单商品或服务展示服务，我们会收集您的浏览信息、搜索记录、收藏记录、关注记录、加购信息、订单信息。</p><p>我们会根据您的上述信息以及其他您已授权的信息，进行数据分析、预测您的偏好特征，在CRMEB服务或者其他第三方应用中向您推送您可能感兴趣的商品/服务、商业广告、商业性短信及其他营销信息。如您需修改向您展示的商品或服务排序或者商业性广告及其他内容，可通过以下方式实现：</p><p>1）&nbsp;如您对首页“为你推荐”展示的商品或服务不感兴趣，可以通过长按被推荐的商品或服务图片，根据提示弹窗选择减少或者屏蔽相关商品或服务类目；</p><p>2）&nbsp;如您不想接收搜索页为您综合推荐的商品或服务，可以选择按销量、价格或者其他页面可选的维度接收相应的搜索结果展示；</p><p>3）&nbsp;如您不想接收商业性短信，可以根据短信内容提示，来取消我们给您发送的手机促销短信；</p><p>4）&nbsp;如您不想接收APP发送的消息通知，可以通过移动端APP“消息中心-消息设置”设置；</p><p>5）&nbsp;如您想管理我们给您发送的个性化广告，您可以在“我的-账户设置-通用-隐私设置-广告管理”中进行设置。<a href=\"http://jzt.jd.com/public/adManage/index.html\">点击前往</a>。</p><p>6）&nbsp;如您想管理我们给您发送的个性化内容，您可以在“我的-账户设置-通用-隐私设置-推荐管理”中进行设置。<a href=\"http://cfe.m.jd.com/privatedomain/prstate/index.html\">点击前往</a>。</p><p>7）&nbsp;其他：您可通过PC端账户设置页面的邮件订阅菜单中取消邮件订阅的促销信息。</p><p><strong>（3）下单及订单管理</strong></p><p>当您准备对您购物车内的商品进行结算时，CRMEB系统会生成您购买商品的订单。您需要在订单中至少填写您的收货人姓名、收货地址以及手机号码，同时该订单中会载明订单号、您所购买的商品或服务信息、下单时间、您应支付的货款金额及支付方式；您可以另外填写收货人的联系电话、邮箱地址信息以增加更多的联系方式确保商品可以准确送达，但不填写这些信息不影响您订单的生成。若您需要开具发票，还需要提供发票抬头、纳税人识别号以及接收发票的电子邮箱。</p><p>在实现部分特殊类型商品或服务交易时还需要您提供其他必要信息，例如您在CRMEB上办理预订机票、火车票、酒店、跟团旅行、购买手机号卡或合约机、办理宽带、跨境交易、申请节能补贴等业务时，您可能需要根据国家法律法规或服务提供方（包括票务销售方、酒店、旅行社及其授权的代理方、基础电信运营商、移动转售运营商、海关等）的要求<strong>提供您的实名信息，这些实名信息可能包括您的身份信息（比如您的出生证明、户口本、身份证、军官&nbsp;证、护照、驾驶证等载明您身份信息的证件复印件或号码）、您本人的照片或视频、姓名、电话号码。这些订单中将可能包含您的行程、酒店地址、您指定的服务地址或设备安装地址（可能是您的家庭地址）信息。</strong>在您为手机购买意外险时，可能还需要您提供<strong>手机IMEI信息</strong>。</p><p>上述所有信息构成您的“订单信息”，我们将使用您的订单信息来（包括与为您提供上述服务的第三方）进行您的身份核验、确定交易、支付结算、完成配送、为您查询订单以及提供客服咨询与售后服务。我们还会使用您的订单信息来判断您的交易是否存在异常以保护您的交易安全。</p><p><strong>（4）支付功能</strong></p><p>在您下单后，您可以选择CRMEB的关联方或与CRMEB合作的第三方支付机构（包括CRMEB支付、微信支付及银联、网联等支付通道，以下称“支付机构”）所提供的支付服务。我们需要将您的CRMEB订单号与交易金额信息与这些支付机构共享以完成下单支付功能。在您使用支付功能时，支付机构会通过其页面收集或验证您的银行卡（含储蓄卡、信用卡）及其他支付必要信息，以实现其确认您的支付指令并完成支付，具体适用各支付机构相应的隐私政策。为便于您正常使用钱包功能，您开通、使用CRMEB钱包的账户金额信息会在相应的支付机构页面展示。</p><p><strong>（5）交付产品与/或服务功能</strong></p><p>在当您下单并选择货到付款或在线完成支付，或选择获取试用品、奖品后，CRMEB、CRMEB的关联方、供应商、与CRMEB合作的商家或第三方配送公司（以下称“配送公司”）将为您完成订单的交付。您知晓并同意，CRMEB、CRMEB的关联方、供应商、与CRMEB合作的商家或配送公司会在上述环节内使用您的订单信息以保证您的订购的商品能够安全送达。</p><p>我们的配送员在为您提供配送服务的同时，基于某些业务法律要求实名认证的需求，会协助您完成实名认证，如您购买手机号卡服务时。我们在此环节会使用您的身份证通过国家有权认证机构的专有设备对您的身份进行核验，我们不会收集您的身份证信息，且我们的配送员均须遵守公司保密制度的规定。</p><p><strong>（6）客服与售后功能</strong></p><p>我们的电话客服和售后功能会使用您的账号信息和订单信息。为保证您的账号安全，我们的呼叫中心客服和在线客服会使用您的账号信息与您核验您的身份。当您需要我们提供与您订单信息相关的客服与售后服务时，我们将会查询您的订单信息。您有可能会在与我们的客服人员沟通时，提供给出上述信息外的其他信息，如当您要求我们变更配送地址、联系人或联系电话。</p><p>若您有获赠或购买商品运费险，您在退换货时所产生的运费可能申请由运费险服务提供商进行赔付，为实现投保和理赔，我们将收集或查询您购买商品的质保起止期、退换货商品快递公司、快递单号、退货地址、投递时间信息。</p><p>2、保障交易安全所必须的功能</p><p>为保障您使用我们的产品与/或服务时系统的稳定性和安全性，防止您的个人信息被非法获取，更准确地预防欺诈和保护账号安全，我们需要收集您的设备信息（设备型号、设备Mac地址、应用进程列表、设备识别码、设备序列号、操作系统及软件版本、设备状态、网络状况）、历史上网记录、日志信息、面部信息、IP地址、位置信息、浏览信息、订单信息、常用软件列表、ssid、wifi信息、IMSI、SIM卡信息、电池使用情况来识别是否为真实自然人用户、是否为异常地点登录、判断您的账号风险，并可能会记录一些我们认为有风险的链接（“URL”）；我们也会收集您的设备信息用于对CRMEB系统问题进行分析、统计流量并排查可能存在的风险，在您选择向我们发送异常信息时予以排查。如果您不提供上述信息，我们则无法在您使用CRMEB服务过程中对您的服务及账号安全进行保护。</p><p><strong>（二）您可自主选择提供的个人信息的情形</strong></p><p>为使您购物更便捷或更有乐趣，从而提升您在CRMEB的网上购物体验，我们在扩展功能中可能会收集和使用您的个人信息。如果您不提供这些个人信息，您依然可以进行网上购物，但您可能无法使用为您带来购物乐趣的扩展功能或在购买某些商品时需要重复填写一些信息。关于这些扩展功能收集的信息和使用目的，<a href=\"http://h5.m.jd.com/babelDiy/Zeus/KJCAdgAUBfQdFqk9QunevchtAAw/index.html?showhead=no\">详见此处</a>。</p><p>请您注意，您开启任一权限即代表您授权我们可以收集和使用相关个人信息来为您提供对应服务，您一旦关闭任一权限即代表您取消了授权，我们将不再基于对应权限继续收集和使用相关个人信息，也无法继续为您提供该权限所对应的服务。您关闭权限的决定不会影响此前基于您的授权所进行的信息收集及使用。</p><p><strong>（三）我们从第三方获得您个人信息的情形</strong></p><p>我们可能从第三方获取您授权共享的账号信息（头像、昵称及授权页面提示的其他信息），并在您同意本隐私政策后将您的第三方账号与您的CRMEB账号绑定，使您可以通过第三方账号直接登录并使用我们的产品与/或服务。我们会将依据与第三方的约定、对个人信息来源的合法性进行确认后，在符合相关法律和法规规定的前提下，使用您的这些个人信息。您也可以使用本机号码来快捷登录，我们会将您的网络信息提供给运营商完成注册或登录。</p><p>（四）CRMEBAPP涉及嵌入第三方代码、插件传输个人信息的情形逐项列举，<a href=\"http://h5.m.jd.com/babelDiy/Zeus/2TUXHKBMgpgckQbcrDvhX4mxjLc7/index.html?showhead=no\">请见此处</a>。</p><p><strong>（五）您个人信息使用的规则</strong></p><p>1、我们会根据本隐私政策的内容，为实现我们的产品与/或服务功能对所收集的个人信息进行使用。<br/>&nbsp;&nbsp;&nbsp; 2、在收集您的个人信息后，我们将通过技术手段对数据进行去标识化处理。<br/>&nbsp;&nbsp;&nbsp; 3、当我们展示您的个人信息时，我们会采用包括去标识化或者匿名化处理方式对您的信息进行脱敏，以保护您的信息安全。</p><p><strong>4、为统计我们的产品/服务使用情况，我们会对经过技术处理的用户数据进行汇总、分析和使用，并与第三方共享处理后的统计信息。我们会通过安全加密的技术处理方式以及其他方式保障信息接收方无法重新识别特定个人。</strong><br/>&nbsp;&nbsp;&nbsp; 5、当我们要将您的个人信息用于本隐私政策未载明的其它用途时，或基于特定目的收集而来的信息用于其他目的时，会事先征求您的明示同意。</p><p><strong>请您理解，我们向您提供的产品与/或服务将不断更新变化。如果您选择使用本隐私政策中尚未列明的其他产品与/或服务时，我们会在收集您的个人信息前通过协议、页面提示等方式向您详细说明信息收集的目的、方式、范围并征求您的同意。若您不同意提供前述信息，您可能无法使用该项产品与/或服务，但不影响您使用现有产品与/或服务。</strong></p><p>&nbsp;</p><p><strong>二、我们如何使用Cookies和同类技术</strong></p><p><strong>（一）Cookies的使用</strong></p><p>1、为实现您联机体验的个性化需求，使您获得更轻松的访问体验。我们会在您的计算机或移动设备上发送一个或多个名为Cookies的小数据文件，指定给您的Cookies&nbsp;是唯一的，它只能被将Cookies发布给您的域中的Web服务器读取。我们向您发送Cookies是为了简化您重复登录的步骤、存储您的购物偏好或您购物车中的商品等数据进而为您提供购物的偏好设置、帮助您优化对广告的选择与互动、帮助判断您的登录状态以及账号或数据安全。</p><p>2、我们不会将&nbsp;Cookies&nbsp;用于本隐私政策所述目的之外的任何用途。您可根据自己的偏好管理或删除Cookies。您可以清除计算机上保存的所有&nbsp;Cookies，大部分网络浏览器会自动接受Cookies，但您通常可根据自己的需要来修改浏览器的设置以拒绝&nbsp;Cookies；另外，您也可以清除软件内保存的所有Cookies。但如果您这么做，您可能需要在每一次访问CRMEB网站时亲自更改用户设置，而且您之前所记录的相应信息也均会被删除，并且可能会对您所使用服务的安全性有一定影响。</p><p><strong>（二）网络Beacon和同类技术的使用</strong></p><p>除Cookies外，我们还会在网站上使用网络Beacon等其他同类技术。我们的网页上常会包含一些电子图像（称为\"单像素\" GIF&nbsp;文件或&nbsp;\"网络&nbsp;Beacon\"）。我们使用网络Beacon的方式有：<br/>&nbsp;&nbsp;&nbsp;&nbsp;（1）通过在CRMEB网站上使用网络Beacon，计算用户访问数量，并通过访问&nbsp;Cookies&nbsp;辨认注册的CRMEB用户。<br/>&nbsp;&nbsp;&nbsp;&nbsp;（2）通过得到的Cookies信息，为您提供个性化服务。</p><p>&nbsp;</p><p><strong>三、我们如何对外提供您的个人信息</strong></p><p><strong>（一）共享</strong></p><p>1、我们不会与CRMEB以外的任何公司、组织和个人共享您的个人信息，但以下情况除外：<br/>&nbsp;&nbsp;&nbsp;&nbsp;（1）事先获得您明确的同意或授权；<br/>&nbsp;&nbsp;&nbsp;&nbsp;（2）根据法律法规、行政及司法部门强制性要求进行提供；<br/>&nbsp;&nbsp;&nbsp;&nbsp;（3）在法律法规允许的范围内，为维护CRMEB、CRMEB的关联方或合作伙伴、您或其他CRMEB用户或社会公众利益、财产或安全免遭损害而有必要提供；<br/>&nbsp;&nbsp;&nbsp;&nbsp;（4）只有共享您的个人信息，才能实现我们的产品与/或服务的核心功能或提供您需要的服务；<br/>&nbsp;&nbsp;&nbsp;&nbsp;（5）应您需求为您处理您与他人的纠纷或争议；<br/>&nbsp;&nbsp;&nbsp;&nbsp;（6）符合与您签署的相关协议（包括在线签署的电子协议以及相应的平台规则）或其他的法律文件约定所提供；<br/>&nbsp;&nbsp;&nbsp;&nbsp;（7）基于学术研究而使用；<br/>&nbsp;&nbsp;&nbsp;&nbsp;（8）基于符合法律法规的社会公共利益、突发公共卫生事件而使用。</p><p>2、为向您提供相关产品或服务，向您展示可能感兴趣的内容，保护您的账号与交易安全，我们可能会将您的个人信息与我们的关联方或者合作伙伴共享，共享内容及目的<a href=\"http://h5.m.jd.com/babelDiy/Zeus/2TUXHKBMgpgckQbcrDvhX4mxjLc7/index.html?showhead=no\"><strong>详见此处</strong></a>。我们的关联方或者合作伙伴如要改变个人信息的处理目的，将再次征求您的授权同意。</p><p><strong>请您注意，您在使用我们服务时自愿共享甚至公开分享的信息，可能会涉及您或他人的个人信息甚至敏感个人信息。请您共享时谨慎考虑并决定。</strong></p><p><strong>（二）委托处理</strong></p><p>我们可能委托授权合作伙伴处理您的个人信息，以便向您提供相应的产品或服务。但我们仅会出于合法、正当、必要、特定、明确的目的共享您的个人信息，并且只会共享提供产品或服务所必要的个人信息。如果我们的合作伙伴将您的个人信息用于我们未委托的用途，其将单独征得您的同意。</p><p>我们的合作伙伴包括以下类型：</p><p>（1）提供技术服务的供应商。我们可能会将您的个人信息提供给支持我们功能的第三方，包括为我们提供基础设施技术服务、数据分析服务及数据处理服务等的供应商。</p><p>（2）广告、分析服务类合作伙伴。我们会遵守法律法规及行业通用安全技术，委托这些合作伙伴处理与广告投放、覆盖面和有效性相关的信息。</p><p>对我们委托合作伙伴处理个人信息的，我们会与其签署数据保护协议，要求其按照协议约定、本隐私政策以及相关法律法规要求来处理个人信息。为了保障数据在第三方安全可控，我们推出了云鼎服务，在云端提供安全可靠的数据使用和存储环境，确保用户数据的安全性。</p><p><strong>（三）转移</strong></p><p>在因合并、分立、解散、被宣告破产等原因需要转移个人信息的，我们会向您告知接收方的名称或者姓名和联系方式，要求接收您个人信息的公司、组织继续受本隐私政策的约束，否则，我们将要求该公司、组织重新向您征求授权同意。</p><p><strong>（四）公开披露</strong></p><p>我们仅会在以下情况，且在采取符合业界标准的安全防护措施的前提下，才会公开披露您的个人信息：<br/>&nbsp;&nbsp;&nbsp;&nbsp;（1）根据您单独同意的授权范围披露相应个人信息；<br/>&nbsp;&nbsp;&nbsp;&nbsp;（2）如果您严重违反法律法规或者相关协议、规则，我们可能会披露您的相关违规行为及我们对您采取的措施。</p><p>&nbsp;</p><p><strong>四、我们如何保护和保存您的个人信息</strong></p><p><strong>（一）我们保护您个人信息的技术与措施</strong></p><p>我们非常重视个人信息安全，并采取一切合理可行的措施，保护您的个人信息：</p><p>1、数据安全技术措施</p><p>我们会采用符合业界标准的安全防护措施，包括建立合理的制度规范、安全技术来防止您的个人信息遭到未经授权的访问使用、修改，避免数据的损坏或丢失。例如：CRMEB的网络服务采取了传输层安全协议等加密技术，通过https等方式提供浏览服务，确保用户数据在传输过程中的安全；CRMEB采取加密技术对用户个人信息进行加密保存，并通过隔离技术进行隔离；在个人信息使用时，例如个人信息展示、个人信息关联计算，我们会采用包括内容替换、SHA256在内多种数据脱敏技术增强个人信息在使用中安全性；CRMEB采用严格的数据访问权限控制和多重身份认证技术保护个人信息，避免数据被违规使用；CRMEB采用代码安全自动检查、数据访问日志分析技术进行个人信息安全审计。</p><p>2、CRMEB为保护个人信息采取的其他安全措施</p><p>CRMEB通过建立数据分类分级制度、数据安全管理规范、数据安全开发规范来管理规范个人信息的存储和使用；通过信息接触者保密协议、监控和审计机制来对数据进行全面安全控制；CRMEB建立数据安全委员会并下设信息保护专职部门、数据安全应急响应组织来推进和保障个人信息安全。</p><p>我们存储您个人信息的底层云技术取得了数据中心联盟颁发的“可信云”认证三级认证、通过了公安部安全等级保护三级认证，同时还获得了ISO27000认证。我们还会举办安全和隐私保护培训课程，加强员工对于保护个人信息重要性的认识。</p><p>我们仅允许有必要知晓这些信息的CRMEB及CRMEB关联方的员工、合作伙伴访问个人信息，并为此设置了严格的访问权限控制和监控机制。我们同时要求可能接触到您个人信息的所有人员履行相应的保密义务。</p><p>互联网并非绝对安全的环境，而且电子邮件、即时通讯、社交软件等与其他用户的交流方式无法确定是否完全加密，我们建议您使用此类工具时请使用复杂密码，并注意保护您的个人信息安全。在通过CRMEB与第三方进行网上产品与/或服务的交易时，您不可避免的要向交易对方或潜在的交易对方披露自己的个人信息，如联络方式或者邮政地址等。请您妥善保护自己的个人信息，仅在必要的情形下向他人提供。</p><p>3、安全事件处置</p><p>为应对个人信息泄露、损毁和丢失等可能出现的风险，我们制定了多项制度，明确安全事件、安全漏洞的分类分级标准及相应的处理流程。我们也为安全事件建立了专门的应急响应团队，按照安全事件处置规范要求，针对不同安全事件启动安全预案，进行止损、分析、定位、制定补救措施、联合相关部门进行溯源和打击。</p><p>一旦发生个人信息安全事件后，我们将按照法律法规的要求，及时向您告知：安全事件的基本情况和可能的影响、我们已采取或将要采取的处置措施、您可自主防范和降低风险的建议、对您的补救措施等。同时，我们将及时将事件相关情况以邮件、信函、电话、推送通知等方式告知您，难以逐一告知个人信息主体时，我们会采取合理、有效的方式发布公告。同时，我们还将按照监管部门要求，主动上报个人信息安全事件的处置情况。</p><p>如果您对我们的个人信息保护有任何疑问，可通过本隐私政策中约定的联系方式联系我们。如您发现自己的个人信息泄密，尤其是您的账号及密码发生泄露，请您立即通过本隐私政策“八、如何联系我们”中明确的联系方式联络我们，以便我们采取相应措施。</p><p><strong>（二）您个人信息的保存</strong></p><p>1、您的个人信息将存储于中华人民共和国境内。如您使用跨境交易服务，且需要向境外传输您的个人信息完成交易的，我们会单独获取您的授权同意并要求接收方按照双方签署的数据保护协议、本隐私政策以及相关法律法规要求来处理您的个人信息。</p><p>2、在您使用我们的产品与/或服务期间，您的个人信息将在为了实现本政策所述目的之期限内保存，同时将结合法律有强制的留存要求期限的规定确定，如《中华人民共和国电子商务法》要求商品和服务信息、交易信息保存时间自交易完成之日起不少于三年。在超出保存期间后，我们会根据适用法律的要求删除您的个人信息，或进行匿名化处理。</p><p>3、请您注意，当您成功注销CRMEB账号后，我们会根据适用法律的要求删除您的个人信息，或进行匿名化处理。</p><p>4、如果我们终止服务或运营，我们会至少提前三十日向您通知，并在终止服务或运营后对您的个人信息进行删除或匿名化处理。</p><p>&nbsp;</p><p><strong>五、您如何管理您的个人信息</strong></p><p>CRMEB非常重视您对个人信息的关注，并尽全力保护您对于您个人信息访问、更正、删除以及撤回同意的权利，以使您拥有充分的能力保障您的隐私和安全。您的权利包括：</p><p>1、访问和更正您的个人信息</p><p>除法律法规规定外，您有权随时访问和更正您的个人信息，具体包括：</p><p>（1）您的账号信息：PC端您可以在“我的CRMEB”页面的“账户设置”菜单中查阅您提交给CRMEB的个人信息，你也可通过上述途径更新除实名认证信息之外的其他个人信息，您的实名认证信息是您通过实名认证时使用的姓名和身份证信息，如您需要变更您的实名认证信息，您可拨打95118服务热线申请变更。移动端具体路径为：账号名称、个人资料信息：首页--“我的”进入我的CRMEB--右上角“设置”进入账号设置—点击头像进入个人信息页账号密码、电话号码、安全信息：首页--“我的”进入我的CRMEB--右上角“设置按钮”--账户与安全；兴趣爱好：首页--“我的”进入我的CRMEB--商品关注、店铺关注、喜欢的内容（具体名称以网页内容为准）。</p><p>（2）您的收货信息：PC端您可以通过访问“我的CRMEB”页面的“账户设置”-“收货地址”菜单中随时添加、更改、删除您的收货地址信息（包括收货人姓名、收货地址、收货人的电话号码或邮箱）；移动端具体路径为：首页--“我的”进入我的CRMEB--右上角“设置按钮”进入账号设置--地址管理。您也可以将最常用的收货地址设置为默认地址，如此，若您下次购买商品时未更改收货地址，您的商品会配送到该默认地址。</p><p>（3）您的订单信息：PC端您可以通过访问“我的订单”页面查看您的所有已经完成、待付款或待售后的订单。移动端具体路径为：移动端首页--“我的”进入我的CRMEB--我的订单/待收款/待收货/退换售后。您可以选择删除已经完成和已取消的订单来删除您的订单信息，但这样可能导致我们无法准确判断您的购买信息而难以提供相应的售后服务，您也无法对删除的订单使用我们的晒单和评价功能。</p><p>（4）您的浏览信息：您可以访问或清除您的搜索历史记录、查看和修改兴趣以及管理其他数据。移动端路径为：搜索历史记录：首页--“我的”进入我的CRMEB--浏览记录；</p><p>（5）您的评论信息：PC端您可以访问您的个人评论，或对商品进行追评。移动端路径为：我的CRMEB--待评价--评价中心。</p><p>（6）您的发票信息：您可以访问或更新或清除您的发票信息，移动端路径为首页--“我的”进入我的CRMEB--右上角“设置”进入账号设置--增票资质。</p><p>（7）您的档案信息：您可以在移动端“账户设置-档案”中，主动添加您的爱车型号、宝宝昵称、性别、生日和学龄、设备型号、尺码、健康档案，使您在购买相关产品和服务时更加便捷，也便于我们向您推荐您可能感兴趣的商品。您可通过此路径对您的上述信息进行删除和修改。</p><p>对于您在使用我们的产品与/或服务过程中产生的其他个人信息需要访问或更正，请随时联系我们。我们会根据本隐私政策所列明的方式和期限响应您的请求。</p><p>2、删除您的个人信息</p><p>您在我们的产品与/或服务页面中可以直接清除或删除的信息，包括订单信息、浏览信息、收货地址信息。</p><p><strong>在以下情形中，您可以向我们提出删除个人信息的请求：</strong></p><p>（1）如果我们处理个人信息的行为违反法律法规；</p><p>（2）如果我们收集、使用您的个人信息，却未征得您的同意；</p><p>（3）如果我们处理个人信息的行为严重违反了与您的约定；</p><p>（4）如果您不再使用我们的产品或服务，或您注销了CRMEB账号；</p><p>（5）如果我们终止服务及运营，或者保存期限已届满。</p><p>若我们决定响应您的删除请求，我们还将同时尽可能通知从我们获得您的个人信息的实体，要求其及时删除，除非法律法规另有规定，或这些实体已获得您的独立授权。</p><p><strong>请您注意，当您成功注销</strong><strong>CRMEB</strong><strong>账号后，我们将对您的个人信息进行删除或匿名化处理。当您或我们协助您删除相关信息后，因为适用的法律和安全技术限制，我们可能无法立即从系统中删除相应的信息，我们将安全地存储您的个人信息并限制对其的任何进一步的处理，直到可以删除或实现匿名化。</strong></p><p>3、改变您授权同意的范围或撤回您的授权</p><p><strong>您可以通过删除信息、关闭设备功能、在</strong><strong>CRMEB</strong><strong>网站或软件中进行隐私设置等方式改变您授权我们继续收集个人信息的范围或撤回您的授权。您也可以通过注销账号的方式，撤回我们继续收集您个人信息的全部授权。</strong></p><p><strong>请您理解，每个业务功能需要一些基本的个人信息才能得以完成，当您撤回同意或授权后，我们无法继续为您提供撤回同意或授权所对应的服务，也不再处理您相应的个人信息。但您撤回同意或授权的决定，不会影响此前基于您的授权而开展的个人信息处理。</strong></p><p>4、注销账号</p><p><strong>您可以在我们的产品中直接申请注销账号。您可以通过移动端APP访问“我的--账户设置-账户与安全-注销</strong><strong>CRMEB</strong><strong>商城服务”完成账号注销；您还可以通过PC端访问“我的</strong><strong>CRMEB</strong><strong>-账户设置-账户安全-注销账号”完成账号注销。关于您注销账号的方式以及您应满足的条件，请详见《</strong><a href=\"http://h5.m.jd.com/babelDiy/Zeus/4HbRrL7MHffRBEuB9AgLNUwAaSos/index.html\"><strong>CRMEB</strong><strong>商城服务账号注销须知</strong></a><strong>》。您注销账号后，我们将停止为您提供产品与/或服务，并</strong>根据适用法律的要求删除您的个人信息，或进行匿名化处理。</p><p>5、获取您的个人信息副本</p><p>您有权获取您的个人信息副本。如您需要获取我们收集的您的个人信息副本，您随时联系我们。在符合相关法律规定且技术可行的前提下，我们将根据您的要求向您提供相应的个人信息副本。</p><p>6、响应您的请求</p><p>如果您无法通过上述方式访问、更正或删除您的个人信息，或您需要访问、更正或删除您在使用我们产品与/或服务时所产生的其他个人信息或者获取个人信息副本，或您认为CRMEB存在任何违反法律法规或与您关于个人信息的收集或使用的约定，您均可以发送电子邮件至<a href=\"mailto:privacy@jd.com\">privacy@***.com</a>或通过本隐私政策中的其他方式与我们联系。为了保障安全，我们可能需要您提供书面请求，或提供您的身份证明文件，我们将在收到您反馈并验证您的身份后的15天内答复您的请求。对于您合理的请求，我们原则上不收取费用，但对多次重复、超出合理限度的请求，我们将视情收取一定成本费用。对于那些无端重复、需要过多技术手段（例如，需要开发新系统或从根本上改变现行惯例）、给他人合法权益带来风险或者非常不切实际（例如，涉及备份磁带上存放的信息）的请求，我们可能会予以拒绝。</p><p>&nbsp;</p><p><strong>六、未成年人的个人信息保护</strong></p><p>1、CRMEB非常重视对未成年人个人信息的保护。若您是18周岁以下的未成年人，在使用我们的产品与/或服务前，<strong>应事先取得您监护人的同意</strong>。CRMEB根据国家相关法律法规的规定保护未成年人的个人信息。</p><p>2、我们不会主动直接向未成年人收集其个人信息。对于经监护人同意而收集未成年人个人信息的情况，我们只会在受到法律允许、监护人同意或者保护未成年人所必要的情况下使用、共享、转让或披露此信息。</p><p>3、如果有事实证明未成年人在未取得监护人同意的情况下注册使用了我们的产品与/或服务，我们会与相关监护人协商，并设法尽快删除相关个人信息。</p><p>4、对于可能涉及的不满14周岁的儿童个人信息，我们进一步采取以下措施予以保障：</p><p>（1）对于收集到的儿童个人信息，我们除遵守本隐私政策关于用户个人信息的约定外，还会秉持正当必要、知情同意、目的明确、安全保障、依法利用的原则，严格遵循《儿童个人信息网络保护规定》等法律法规的要求进行存储、使用、披露，且不会超过实现收集、使用目的所必须的期限，到期后我们会对儿童个人信息进行删除或匿名化处理。我们会指定专人负责儿童个人信息保护事宜，并设立了儿童个人信息保护的专门邮箱childprivacy@***.com。我们还会制定儿童个人信息保护的内部专门制度。</p><p>（2）当您作为监护人为被监护的儿童选择使用CRMEB相关服务时，我们可能需要向您收集被监护的儿童个人信息，用于向您履行相关服务之必要。在具体服务中需要向您收集儿童个人信息的，我们会事先取得您的授权同意，并告知您收集的目的和用途。如果您不提供前述信息，您将无法享受我们提供的相关服务。此外，您在使用晒单、评价及问答功能分享商品相关信息时可能会主动向我们提供儿童个人信息，请您明确知悉并谨慎选择。您作为监护人应当正确履行监护职责，保护儿童个人信息安全。若儿童本人需要注册或使用我们的产品与/或服务，您应正确引导并予以监护。</p><p>（3）儿童或其监护人有权随时访问和更正儿童个人信息，还可以向我们提出更正和删除的请求。如您对儿童个人信息相关事宜有任何意见、建议或投诉、举报，请联系我们。我们会随时为您提供帮助。</p><p>&nbsp;</p><p><strong>七、通知和修订</strong></p><p>1、为给您提供更好的服务以及随着CRMEB业务的发展，本隐私政策也会随之更新。但未经您明确同意，我们不会削减您依据本隐私政策所应享有的权利。我们会通过在CRMEB网站、CRMEB移动端上发出更新版本并在生效前通过网站公告或以其他适当方式提醒您相关内容的更新，也请您访问CRMEB以便及时了解最新的隐私政策。</p><p>2、对于重大变更，我们还会提供更为显著的通知（我们会通过包括但不限于邮件、短信或在浏览页面做特别提示等方式，说明隐私政策的具体变更内容）。</p><p>本隐私政策所指的重大变更包括但不限于：</p><p>（1）我们的服务模式发生重大变化。如处理个人信息的目的、处理的个人信息类型、个人信息的使用方式等；</p><p>（2）我们在所有权结构、组织架构等方面发生重大变化。如业务调整、破产并购等引起的所有者变更等；</p><p>（3）个人信息共享、转移或公开披露的主要对象发生变化；</p><p>（4）您参与个人信息处理方面的权利及其行使方式发生重大变化；</p><p>（5）我们负责处理个人信息安全的责任部门、联络方式及投诉渠道发生变化时；</p><p>（6）个人信息安全影响评估报告表明存在高风险时。</p><p>3、我们还会将本隐私政策的旧版本存档，供您查阅。</p><p>4、为了您能及时接收到通知，建议您在联系方式更新时及时通知我们。如您在本政策更新生效后继续使用我们的服务，即代表您已充分阅读、理解并接受更新后的政策并愿意受更新后的政策约束。我们鼓励您在每次使用我们服务时都查阅本政策。您可以在CRMEBAPP通过“我的-账户设置-关于CRMEBAPP-隐私政策”中查看本政策。</p><p>&nbsp;</p><p><strong>八、如何联系我们</strong></p><p>1、如您对本隐私政策或您个人信息的相关事宜或者投诉、举报、有任何问题、意见或建议，请通过以下方式与我们联系。</p><p>个人信息保护负责人邮箱<a href=\"mailto:privacy@jd.com\">privacy@***.com</a></p><p>联系电话：【950618】</p><p>联系地址：北京亦庄经济技术开发区科创11街18号院</p><p>您还可以随时通过访问<a href=\"http://help.jd.com/\">http://help.***.com</a>在线客服系统或拨打我们的任何一部客服电话等多种方式与我们联系。</p><p>2、一般情况下，我们将在15天内回复。如果您对我们的回复不满意，特别是我们的个人信息处理行为损害了您的合法权益，您还可以向网信、电信、公安及工商等监管部门进行投诉或举报。</p><p>&nbsp;</p><p>附：个人信息及敏感个人信息示例（非CRMEBAPP或网站所收集的个人信息，仅作示例说明）</p><p>个人信息是以电子或者其他方式记录的与已识别或者可识别的自然人有关的各种信息，不包括匿名化处理后的信息。敏感个人信息是一旦泄露或者非法使用，容易导致自然人的人格尊严受到侵害或者人身、财产安全受到危害的个人信息，包括生物识别、宗教信仰、特定身份、医疗健康、金融账户、行踪轨迹等信息，以及不满十四周岁未成年人的个人信息。（本定义出自于《中华人民共和国个人信息保护法》）。</p><p><br/></p>', 0, 1, 1664275172);
INSERT INTO `eb_agreement` (`id`, `type`, `title`, `content`, `sort`, `status`, `add_time`) VALUES (4, 4, '用户协议', '<h3>一、注册协议条款的确认和接受</h3><p>***网(以下亦称“本网站”)同意按照本协议的规定及其不定时发布的操作规则提供基于互联网和移动互联网的相关服务(以下称“网络服务”)。</p><p>为获得网络服务, 申请人应当认真阅读、充分理解本《协议》中各条款, 包括免除或者限制文都责任的免责条款及对用户的权利限制条款。审慎阅读并选择接受或不接受本《协议》(未成年人应在法定监护人陪同下阅读)。</p><p>同意接受本协议的全部条款的, 申请人应当按照页面上的提示完成全部的注册程序, 并在注册程序过程中点击“同意”按钮, 否则视为不接受本《协议》全部条款, 申请人应当终止并退出申请。</p><p>本《协议》可由文都定期更新, 更新后的协议条款一旦公布即代替原来的协议条款, 恕不再另行通知, 用户可在文都查阅最新版协议条款。在文都修改《协议》条款后, 如果用户不接受修改后的条款, 请立即停止使用文都提供的网络服务, 继续使用的用户将被视为已接受了修改后的协议。</p><h3>二、服务内容</h3><p>1、网络服务的具体内容由文都根据实际情况提供, 包括学习资讯、学习工具、文都社群、文都问答、SIS在线测评、文都直播、文都网校、文都中小学、文都国际教育、文都考研集训营、泉题库及其旗下APP相关应用等服务。</p><p>2、提供的网络服务包括收费和免费。收费服务包括但不限于文都网、文都网校和APP的部分收费课程, 用户使用收费网络服务需要支付约定费用。对于收费服务, 文都会在用户使用之前给予用户明确的提示, 只有用户根据提示确认同意支付相关费用, 用户才能使用该等收费服务。如用户未支付相关费用, 则文都有权不向用户提供该等收费服务。</p><p>3、用户理解, 文都仅提供文都明确承诺的网络服务, 除此之外与相关网络服务有关的设备(如个人电脑、手机、及其他与接入互联网或移动网有关的装置)及所需的费用(如为接入互联网而支付的电话费及上网费、为使用移动网络而支付的手机费)均应由用户自行负担。</p><p>4、用户理解，文都网/文都网校/文都直播平台提供并提请用户在购买课程前先完整试听。用户可按《文都网校退班政策说明》除特别说明外，包括但不限于PC端和移动端下载课件在内的所有服务均附期限，到期终止。用户应在截止日期前享受其购买的服务。</p><h3>三、用户帐号</h3><p>1、经本网站注册系统完成注册程序并通过身份认证的用户即为正式用户。</p><p>2、如发现用户帐号中含有不雅文字或不恰当名称的, 文都保留注销其用户帐号的权利。</p><p>3、用户帐号的所有权归文都, 用户完成申请注册手续后, 用户享有使用权。3个月未使用的用户账号, 文都保留收回的权利。</p><p>4、用户有义务保证密码和帐号的安全, 用户利用该帐号所进行的一切活动引起的任何损失或损害, 由用户自行承担全部责任, 文都不承担任何责任。如用户发现帐号遭到未授权的使用或发生其他任何安全问题, 应立即修改账号密码并妥善保管。因黑客行为或用户的保管疏忽导致帐号非法使用, 文都不承担任何责任。</p><p><strong>5、用户帐号和密码仅由初始申请注册人使用，用户不得将自己用户账户或密码有偿或无偿以转让、出借、授权等方式提供给第三人操作和使用, 否则用户应当自行承担因违反此要求而遭致的任何损失。违反本项约定的，文都并保留收回账号的权利。若因违反本约定对他人造成损害的，用户应与实际使用人承担连带赔偿责任，同时文都保留追究用户违约责任的权利。</strong></p><p>6、用户帐号在丢失、遗忘密码及因合用产生使用权归属纠纷后, 须遵照文都的申诉途径请求找回帐号。用户可以凭初始注册资料向文都申请找回帐号。文都的账户恢复机制仅负责识别申请用户所提资料与系统记录资料是否一致, 而无法识别申诉人是否系帐号的真正使用权人。对用户因被他人冒名申请而致的任何损失, 文都不承担任何责任, 用户知晓帐号及密码保管责任在于用户, 文都并不承诺帐号丢失或遗忘密码后用户一定能通过申诉找回帐号。用户应当谨慎填写初始手机号或注册邮箱作为确认接收争议帐号的指定邮箱。</p><p>7、文都建议用户应当使用本人名义为用户账户充值或行使付款行为。若用户存在使用第三人的名义进行充值或付款，或委托第三人代为充值或付款之行为的，则以上行为被视作本人的行为，若由于该第三人行为导致充值或付款行为失败或成功后又被撤销的，均被认为是用户本人真实意思的表示和用户本人实施的行为，由此所造成的一切法律后果均由用户自行承担。</p><h3>四、使用规则</h3><p>1、用户在使用文都网络服务过程中, 必须遵循国家的相关法律法规, 不得发布危害国家安全、色情、暴力、侵犯版权等任何合法权利等非法内容; 也不得利用文都平台发布含有虚假、有害、胁迫、侵害他人隐私、骚扰、侵害、中伤、粗俗、或其它道德上令人反感的内容。</p><p>2、本网站可依其合理判断, 对违反有关法律法规或本协议约定; 或侵犯、妨害、威胁任何人权利或安全的内容, 或者假冒他人的行为, 文都有权停止传输任何前述内容, 并有权依其自行判断对违反本条款的任何用户采取适当的法律行动, 包括但不限于, 删除具有违法性、侵权性、不当性等内容, 阻止其使用文都全部或部分网络服务, 并且依据法律法规保存有关信息并向有关部门报告等。</p><p>3、对于经由本网络服务而传送的内容, 文都不保证前述内容的正确性、完整性或品质。用户在接受本服务时, 有可能会接触到令人不快、不适当或令人厌恶的内容。在任何情况下, 文都均不对任何内容负责, 包括但不限于任何内容发生任何错误或纰漏以及衍生的任何损失或损害。文都有权(但无义务)自行拒绝或删除经由文都网络服务提供的任何内容。用户使用上述内容, 应自行承担风险。</p><p>4、对于用户通过本网络服务(包括但不限于文都网、文都社群、文都中小学、文都国际教育、文都网校、泉题库、SIS在线测评及对应APP、相关应用等服务)上传到文都上可公开获取区域的任何内容, 用户同意文都在全世界范围内具有免费的、永久性的、不可撤销的、非独 家的和完全再许可的权利和许可, 以使用、复制、修改、改编、出版、翻译、据以创作衍生作品、传播、表演和展示此等内容(整体或部分), 和/或将此等内容编入当前已知的或以后开发的其他任何形式的作品、媒体或技术中。</p><p>5、用户通过文都网络服务所发布的任何内容并不反映文都的观点或政策, 文都对此不承担任何责任。用户须对上述内容的真实性、合法性、无害性、有效性等全权负责, 与用户所发布信息相关的任何法律责任由用户自行承担, 与文都无关。</p><h3>五、版权声明</h3><p>本网站提供的网络服务中包含的任何文本、图片、图形、音频和/或视频资料均受版权、商标和/或其它财产所有权法律的保护, 未经相关权利人同意, 上述资料均不得在任何媒体直接或间接发布、播放、出于播放或发布目的而改写或再发行, 或者被用于其他任何商业目的。所有以上资料或资料的任何部分仅可作为私人和非商业用途保存。文都不就由上述资料产生或在传送或递交全部或部分上述资料过程中产生的延误、不准确、错误和遗漏或从中产生或由此产生的任何损害赔偿, 以任何形式, 向用户或任何第三方负责。</p><h3>六、隐私保护</h3><p>1、保护用户隐私是文都的一项基本政策, 本网站保证不对外公开或向第三方提供用户的注册资料及用户在使用网络服务时存储在文都内的非公开内容, 但下列情况除外:</p><p>（1）事先获得用户的书面明确授权;</p><p>（2）根据有关的法律法规要求;</p><p>（3）按照相关政府主管部门的要求;</p><p>（4）为维护社会公众的利益;</p><p>（5）为维护本网站的合法权益;</p><p>2、为了更好地为用户提供全面服务，用户同意文都可将用户注册资料及使用信息提供文都关联公司使用。文都保证前述关联公司同等级地严格遵循本协议第六条第1款之隐私保护责任。</p><p>3、用户同意：文都或文都运营商的关联公司在必要时有权根据用户注册时或接受服务时所提供的联系信息（包括但不限于电子邮件地址、联系电话、联系地址、即时聊天工具账号等），通过电子邮件、电话、短信、邮寄、即时聊天、弹出页面等方式向用户发送如下信息：</p><p>（1）各类重要通知信息，可能包括但不限于订单、交易单、修改密码提示等重要信息。此类信息可能对用户的权利义务产生重大的有利或不利影响，用户务必及时关注。</p><p>（2）商品和服务广告、促销优惠等商业性信息。若用户不愿意接收此类信息，则可通过告知（口头或书面）的方式通知文都或文都运营商的关联公司取消发送，亦可通过文都或文都运营商关联公司所提供的相应退订功能（若有）进行退订。</p><h3>七、协议的用途、更新和效力</h3><p>1、本协议之服务条款用以规范用户使用文都提供的服务,本协议与文都社区行为准则构成完整的协议。</p><p>2、鉴于国家法律法规不时变化及文都运营之需要，文都有权对本协议条款不时地进行修改，修改后的协议一旦被公布于文都上即告生效，并替代原来的协议。 用户有义务不时关注并阅读最新版的协议及网站公告。如用户不同意更新后的协议，则应立即停止接受文都依据本协议提供的服务；若用户继续使用文都提供的服务的，即视为同意更新后的协议。 如果本协议中任何一条被视为废止、无效或因任何理由不可执行，该条应视为可分的且并不影响任何其余条款的有效性和可执行性。</p><h3>八、联系方式</h3><p>当您有个人信息相关问题或其他的投诉、建议等，可以通过如下方式与文都联系，文都将尽快审核所涉及内容，并于15个工作日内对于您的问题、投诉、建议进行回复；</p><p><br/></p><p><br/></p>', 0, 1, 1664275182);
INSERT INTO `eb_agreement` (`id`, `type`, `title`, `content`, `sort`, `status`, `add_time`) VALUES (5, 5, '注销协议', '<p><strong>&nbsp;注销CRMEB帐号是不可恢复的操作</strong>，你应自行备份CRMEB帐号相关的信息和数据。操作之前，请确认与CRMEB帐号相关的所有服务均已进行妥善处理。</p><p><strong>&nbsp; 请谨记</strong>：注销CRMEB帐号，你将无法再使用本CRMEB帐号或找回你添加或绑定的任何内容或信息（即使你使用相同的手机号码再次注册并使用CRMEB），包括但不限于：</p><p>（1）你将无法登录、使用本CRMEB帐号。你的朋友将无法通过本CRMEB帐号联系你。</p><p>（2）你CRMEB帐号的个人资料和历史信息（包含昵称、头像、二维码名片、消息记录、朋友圈内容、相片、收藏等）都将无法找回。</p><p>（3）注销CRMEB帐号前，你必须注销CRMEB支付（国内及海外）账户。你需妥善处理CRMEB支付账户下所有资金问题。</p><p>（4）你通过CRMEB帐号使用、授权登录或绑定CRMEB帐号后使用的CRMEB公司或第三方的其他服务（包括但不限于CRMEB游戏、理财通、CRMEB支付、第三方网站、第三方游戏、城市服务、生活缴费、机船车票、微粒贷、微票儿、京东、大众点评、美丽说、滴滴出行等）的所有记录将无法找回。你将无法再登录、使用前述服务，你曾获得的充值余额、游戏道具、积分、会籍、资格、订单、优惠券、礼品卡、票券及其他卡券等视为你自行放弃，将无法继续使用。你理解并同意，CRMEB无法协助你重新恢复前述服务。</p><p>（5）你CRMEB帐号所关注的所有CRMEB公众帐号将被取消关注，与CRMEB公众帐号的所有功能或服务都将无法继续使用。</p><p>（6）如果你的CRMEB帐号同时是CRMEB公众帐号（包括：订阅号、服务号、企业号、小程序等）、CRMEB开放平台开发者帐号、企业CRMEB的管理员，你需先解除相关身份。</p><p>（7）在CRMEB帐号注销期间，如果你的CRMEB帐号被他人投诉、被国家机关调查或者正处于诉讼、仲裁程序中，CRMEB有权自行终止你CRMEB帐号的注销而无需另行得到你的同意。</p><p>&nbsp; 请注意，注销你的CRMEB帐号并不代表本CRMEB帐号注销前的帐号行为和相关责任得到豁免或减轻。</p><p><br/></p>', 0, 1, 1664275192);
INSERT INTO `eb_agreement` (`id`, `type`, `title`, `content`, `sort`, `status`, `add_time`) VALUES (6, 6, '积分协议', '<p><b>积分适用范围</b><br/><br/>1. 积分仅可在本商城使用，如用户帐号暂停使用，则商城将取消该用户帐号内积分相关使用权益。<br/>2. 积分可直接用于支付商城网站订单。<br/>3. 积分可在积分商城兑换商品。<br/><br/><b>积分冻结期</b><br/><br/>1. 通过基础购物获得的积分，有一定的冻结期，冻结期内的积分不能使用。<br/>2. 获得积分的订单如发生退款，则冻结期内的积分会自动退回。<br/>3. 积分的冻结期以商城设置的活动规则为准。<br/><br/><b>下单时使用</b><br/><br/>1. 购买商品订单，积分和现金有一定的抵扣比例，抵扣比例由商城进行设置。<br/>2. 用户每单可使用的积分有一定的限额，限额由商城进行设置。<br/>3. 积分功能由商城选择是否使用，最终解释权归商城运营者所有<br/><br/><b>积分获取</b><br/><br/>1. 用户可通过签到获取积分，此积分无冻结期<br/>2. 用户可通过购物获取积分，此积分有冻结期</p>', 0, 1, 1666918736);
INSERT INTO `eb_article` (`id`, `cid`, `title`, `author`, `image_input`, `synopsis`, `share_title`, `share_synopsis`, `visit`, `sort`, `url`, `status`, `add_time`, `hide`, `admin_id`, `mer_id`, `product_id`, `is_hot`, `is_banner`) VALUES (1, '1', '祝贺：CRMEB开源商城系统Gitee star突破10000+丨CRMEB标准版优惠中', 'CRMEB', 'http://min.rongyao.crmeb.store/uploads/attach/2023/02/20230215/8634bcfc0e07137c1b6fd33c286e3cd3.png', '众邦科技秉承“开放、共享”的互联网精神，坚持开放系统、共建互联网生态，将CRM（客户关系管理）与EB（电子商务）应用场景进行深度集成，身体力行为开发者赋能，同时围绕新零售电商发展趋势，打造出CRMEB开源商城系统，坚持全开源无加密，不断丰富系统功能，支持免费商用，统一对外接口，可满足用户的多样化开发需求。', '', '', '5', 0, '', 1, '1676451047', 0, 0, 0, 0, 1, 1);
