INSERT INTO `eb_article_content` (`nid`, `content`) VALUES (1, '<p><font face=\"黑体\">众邦科技秉承“开放、共享”的互联网精神，坚持开放系统、共建互联网生态，将CRM（客户关系管理）与EB（电子商务）应用场景进行深度集成，身体力行为开发者赋能，同时围绕新零售电商发展趋势，打造出CRMEB开源商城系统，坚持全开源无加密，不断丰富系统功能，支持免费商用，统一对外接口，可满足用户的多样化开发需求。</font></p><p><strong><font face=\"黑体\">做开源项目很难，做出好的开源项目更难，6年，我们坚守初心，未来，我们会一直坚持！</font></strong></p><p><font face=\"黑体\"><strong>CRMEB开源商城系统Gitee地址： </strong><a href=\"http://gitee.com/ZhongBangKeJi/CRMEB\" target=\"_blank\">http://gitee.com/ZhongBangKeJi/CRMEB</a></font></p><p><font face=\"黑体\"><br/></font></p><p data-we-empty-p=\"\" style=\"text-align:center;\"><font face=\"黑体\"><img src=\"http://min.rongyao.crmeb.store/uploads/attach/2023/02/20230215/8634bcfc0e07137c1b6fd33c286e3cd3.png\" style=\"max-width:100%;\"/><br/></font></p><p><font face=\"黑体\"><br/></font></p><p><font face=\"黑体\">自立项以来，CRMEB开源商城系统更新千余次，累计服务40万+开发者，真正做到了赋能开发者，减少重复造轮子，帮助众多开发者快速上手，节省开发时间，提高开发效率，助力企业实现数字化经营！</font></p><p><font face=\"黑体\"><br/></font></p><h3 style=\"text-align:center;\"><strong><font color=\"#000000\" face=\"黑体\">CRMEB标准版（商业版）限时仅需598元/套</font></strong></h3><div><strong><font color=\"#000000\" face=\"黑体\"><br/></font></strong></div><p style=\"text-align:center;\"><strong><font color=\"#1c487f\" face=\"黑体\">官方正版授权、专属会员群、 赠送离线版接口文档！ 全开源无加密、方便二开、终身免费升级~</font></strong></p><p style=\"text-align:center;\"><strong><font color=\"#1c487f\" face=\"黑体\"><br/></font></strong></p><p style=\"text-align:center;\"><strong>【手机扫描下方二维码，立即咨询购买】</strong><strong><font face=\"黑体\"><br/></font></strong></p><p style=\"text-align:center;\"><font face=\"黑体\"><img src=\"http://min.rongyao.crmeb.store/uploads/attach/2023/02/20230215/ef39bf5d94bf554d07c825baa124f951.png\" style=\"max-width:100%;\"/></font><strong><br/></strong></p><h3><strong></strong></h3>');
