-- ----------------------------
-- Table structure for eb_system_route
-- ----------------------------
DROP TABLE IF EXISTS `eb_system_route`;
CREATE TABLE `eb_system_route` (
  `id` int NOT NULL AUTO_INCREMENT,
  `cate_id` int NOT NULL DEFAULT '0' COMMENT '分类',
  `app_name` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT 'api' COMMENT '应用名',
  `name` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '路由名称',
  `describe` text CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '功能描述',
  `path` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '路由路径',
  `method` enum('POST','GET','DELETE','PUT','*') CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT 'GET' COMMENT '路由请求方式',
  `file_path` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '文件路径',
  `action` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '方法名称',
  `query` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT 'get请求参数',
  `header` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT 'header',
  `request` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '请求数据',
  `request_type` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '请求类型',
  `response` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '返回数据',
  `request_example` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '请求示例',
  `response_example` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '返回示例',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '类型',
  `add_time` timestamp NULL DEFAULT NULL COMMENT '添加时间',
  `delete_time` timestamp NULL DEFAULT NULL COMMENT '删除字段',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `path` (`path`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1865 DEFAULT CHARSET=utf8mb3 COMMENT='路由规则表';

-- ----------------------------
-- Records of eb_system_route
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for eb_system_route_cate
