  `egInvestBrief` varchar(255) NOT NULL DEFAULT '' COMMENT '举例投资情况',
  `isExternalInvest` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否曾获得外部投资',
  `unionid` varchar(255) NOT NULL DEFAULT '' COMMENT '微信unionid',
  `councilSuport2` varchar(255) NOT NULL DEFAULT '' COMMENT '理事会支持2',
  `finacialReport` varchar(255) NOT NULL DEFAULT '' COMMENT '财务报表',
  `latestBusines` varchar(255) NOT NULL DEFAULT '' COMMENT '最新业务',
  `projectStatus` tinyint(1) NOT NULL DEFAULT '0' COMMENT '项目状态',
  `uploadBPPath` varchar(255) NOT NULL DEFAULT '' COMMENT 'BP文件',
