  `financePlan` varchar(64) NOT NULL DEFAULT '' COMMENT '财务融资计划',
  `productPlan` varchar(64) NOT NULL DEFAULT '' COMMENT '产品计划',
  `businessPlan` varchar(64) NOT NULL DEFAULT '' COMMENT '公司业务发展计划',
  `sizeMeasurement` varchar(64) NOT NULL DEFAULT '' COMMENT '市场规模测定依据',
  `marketSize` varchar(64) NOT NULL DEFAULT '' COMMENT '目标市场规模',
  `marketPain` varchar(64) NOT NULL DEFAULT '' COMMENT '市场痛点',
