  `productIntro` varchar(64) NOT NULL DEFAULT '' COMMENT '产品介绍',
  `businessModel` varchar(64) NOT NULL DEFAULT '' COMMENT '商业模式',
  `industry` varchar(64) NOT NULL DEFAULT '' COMMENT '所属行业',
  `projectBrief` varchar(64) NOT NULL DEFAULT '' COMMENT '公司简介',
  `scoreState` varchar(64) NOT NULL DEFAULT '' COMMENT '项目得分说明',
  `totalScore` varchar(10) NOT NULL DEFAULT '0' COMMENT '项目得分',
  `openid` varchar(255) NOT NULL DEFAULT '' COMMENT '当前登录者的微信Id',
  `companyName` varchar(255) NOT NULL DEFAULT '' COMMENT '项目名称或公司名称',
  `add_time` int NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int NOT NULL DEFAULT '0' COMMENT '更新时间',
